import React from 'react';

const styles = {
  div: {
    margin: "20px",
    padding: "10px",
  },
  headingStyle: {
    fontSize: '100px',
  },
  textField: {
    height: "100px",
  },
  submitBtn: {
    background: "#54A578",
    color: "white",
    '&:hover': {
      background: "#ffa682 !important",
    },
  },
};

export default function Contact() {
  return (
    <div>
      <h1 style={styles.headingStyle}>contact</h1>
      <form class="form-floating needs-validation">
        <div class="form-floating mb-3">
          <input type="name" class="form-control" id="floatingInput" placeholder="name" required></input>
          <label for="floatingInput">name</label>
        </div>
        <div class="form-floating mb-3">
          <input type="email" class="form-control" id="floatingInputInvalid" placeholder="name@example.com" required></input>
          <label for="floatingInput">email address</label>
        </div>
        <div class="form-floating">
          <textarea class="form-control" placeholder="Leave a comment here" id="floatingTextarea2" style={styles.textField}></textarea>
          <label for="floatingTextarea2">Comments</label>
        </div>
        <div class="m-3">
          <button class="btn" type="submit" style={styles.submitBtn}>Submit form</button>
        </div>
      </form>
    </div>
  );
}
